import React from "react";

const Gallery = () => {
    return (
        <div>
            <section id="gallery">
                <div className="container my-5 py-5">
                    <div className="row justify-content-center">
                        <div className="col-sm-6">
                            <h3 className="fs-5 text-center text-white">Gallery</h3>
                            <p className="lead text-center text-white">Here are some of my favorite shots</p>
                        </div>
                    </div>
                </div>
            </section>
        </div>
    );
} 

export default Gallery;
